import React from 'react';

const ServiceItem = ({ service, editService, deleteService }) => {
  return (
    <div>
      <h3>{service.name}</h3>
      <p>{service.description}</p>
      <button onClick={() => editService(service)}>Editar</button>
      <button onClick={() => deleteService(service)}>Excluir</button>
    </div>
  );
};

export default ServiceItem;
